public class Solution {
    private const int Mod = 1000000007;

    private static int GetPrimeScore(int n) {
        int score = 0;
        for (int i = 2; i <= n / i; i++) {
            if (n % i == 0) {
                while (n % i == 0) n /= i;
                score++;
            }
        }
        if (n > 1) score++;
        return score;
    }

    public int MaximumScore(IList<int> nums, int k) {
        var elements = nums.Select(n => new { Value = n, Score = GetPrimeScore(n) })
                           .OrderByDescending(x => x.Score)
                           .ThenByDescending(x => x.Value)
                           .Take(k)
                           .ToList();

        long result = 1;
        foreach (var element in elements) {
            result = result * element.Value % Mod;
        }

        return (int)result;
    }
}
